import React from 'react'

const Form = () => {
    return (
        <form>
                <div className='form-group'>
                    <label>Search</label>
                    <input className='form-control' type="text" />
                </div>
                <button type="submit" class="btn btn-primary">Submit</button>
            </form>
    )
}

export default Form
